import React, {Component} from 'react';
import Navbar from './nav';
import OpenMenu from './openMenu';

class Root extends Component {
    render(){
        return(
            <div>
                <OpenMenu />
                <Navbar />
            </div>
        );
    }
}   

export default Root;
